import Topbar from "./components/topbar/Topbar";
import Sidebar from "./components/sidebar/Sidebar";
import Home from "./pages/home/Home";
import "./app.css";
import { Component } from "react";
class App extends Component {
  render() {
    return (
      <div className="App">
        <Topbar/>

        <div className="container">
          <Sidebar/>
          <Home/>
        </div>
      </div>
    );
  }
}

export default App;
